import './App.css';
import React from 'react';
import { Routes, Route } from 'react-router-dom'

function App() {
  return(
    <Routes>
      <Route path="/" element={Home}></Route>
      <Route path="/add-new" element={AddNew}></Route>
      <Route path= "view-all" element={ViewALl}></Route>
    </Routes>
  );
};


export default App;
